-- Crear la extensión PostGIS una sola vez
CREATE EXTENSION IF NOT EXISTS postgis;


-- Eliminar tablas en el orden correcto para evitar errores de dependencia
DROP TABLE IF EXISTS mediciones CASCADE;
DROP TABLE IF EXISTS ubicaciones_estaciones CASCADE;
DROP TABLE IF EXISTS tiempos_exposicion CASCADE;
DROP TABLE IF EXISTS estaciones CASCADE;
DROP TABLE IF EXISTS variables_ambientales CASCADE;
DROP TABLE IF EXISTS autoridades_ambientales CASCADE;
DROP TABLE IF EXISTS municipios CASCADE;
DROP TABLE IF EXISTS departamentos CASCADE;

-- Creación de las tablas de catálogo (Dimensiones)

CREATE TABLE departamentos (
    id_departamento INTEGER PRIMARY KEY,
    nombre_departamento VARCHAR(100) NOT NULL
);

CREATE TABLE municipios (
    id_municipio INTEGER PRIMARY KEY,
    nombre_municipio VARCHAR(100) NOT NULL UNIQUE, -- Restricción UNIQUE añadida aquí
    id_departamento INTEGER REFERENCES departamentos(id_departamento)
);

CREATE TABLE autoridades_ambientales (
    id_autoridad_ambiental SERIAL PRIMARY KEY,
    nombre VARCHAR(100) UNIQUE NOT NULL
);

CREATE TABLE variables_ambientales (
    id_variable_ambiental SERIAL PRIMARY KEY,
    nombre_variable VARCHAR(50) UNIQUE NOT NULL,
    unidades VARCHAR(20) NOT NULL DEFAULT 'µg/m³',
    es_contaminante BOOLEAN DEFAULT true
);

CREATE TABLE estaciones (
    id_estacion INTEGER PRIMARY KEY,
    nombre_estacion VARCHAR(100) NOT NULL,
    tipo_estacion VARCHAR(50) NOT NULL,
    id_municipio INTEGER REFERENCES municipios(id_municipio),
    id_autoridad_ambiental INTEGER REFERENCES autoridades_ambientales(id_autoridad_ambiental)
);

CREATE TABLE tiempos_exposicion (
    id_exposicion SERIAL PRIMARY KEY,
    id_variable_ambiental INTEGER NOT NULL REFERENCES variables_ambientales(id_variable_ambiental), 
    tiempo_horas SMALLINT CHECK (tiempo_horas IN (1, 3, 8, 24)),
    UNIQUE(id_variable_ambiental, tiempo_horas)
);

CREATE TABLE ubicaciones_estaciones (
    id_ubicacion SERIAL PRIMARY KEY,
    id_estacion INTEGER REFERENCES estaciones(id_estacion) ON DELETE CASCADE,
    anio SMALLINT NOT NULL,
    latitud NUMERIC(10, 9) NOT NULL,
    longitud NUMERIC(10, 8) NOT NULL,
    geom GEOMETRY(Point, 4326) -- Columna PostGIS para las coordenadas
);

-- Creación de la tabla de hechos (Mediciones) - VERSIÓN CORREGIDA

CREATE TABLE mediciones (
    id_medicion SERIAL PRIMARY KEY,
    id_estacion INTEGER REFERENCES estaciones(id_estacion),
    id_exposicion INTEGER REFERENCES tiempos_exposicion(id_exposicion), -- VINCULACIÓN CORRECTA
    anio SMALLINT NOT NULL,
    promedio DECIMAL(10, 2),
    mediana DECIMAL(10, 2),
    percentil_98 DECIMAL(10, 2),
    maximo DECIMAL(10, 2),
    minimo DECIMAL(10, 2),
    excedencias_limite_actual INTEGER,
    porcentaje_excedencias DECIMAL(5, 2) CHECK (porcentaje_excedencias >= 0),
	dias_excendecias INTEGER,
    no_datos INTEGER,
    representatividad_temporal DECIMAL(5, 2),
    fecha_hora_maximo TIMESTAMP,
    fecha_hora_minimo TIMESTAMP,
    CONSTRAINT unique_medicion UNIQUE(id_estacion, id_exposicion, anio)
);

-- Ver las ubicaciones (haga click en la columna geom en un icono similar a una bandera para ver en el mapa de postgis)
SELECT * FROM ubicaciones_estaciones;

-- Ver las ubicaciones en formato Point(Longitud, Latitud)
SELECT 
    id_estacion, 
    anio, 
    longitud, 
    latitud, 
    ST_AsText(geom) AS coordenadas_legibles 
FROM 
    ubicaciones_estaciones;


