CREATE TABLE ubicaciones_municipios (
  id_municipio INT PRIMARY KEY REFERENCES municipios(id_municipio),
  latitud NUMERIC(10,6),
  longitud NUMERIC(10,6)
);

-- INDEX
-- Acelerar radicalmente las búsquedas por ubicación geográfica.
CREATE INDEX idx_ubicaciones_geom ON ubicaciones_estaciones USING GIST (geom);

-- Acelerar los filtros por estación en la tabla mediciones.
CREATE INDEX idx_mediciones_id_estacion ON mediciones (id_estacion);

-- Acelerar los filtros por tipo de medición (ej: PM2.5 a 24h) en la tabla mediciones.
CREATE INDEX idx_mediciones_id_exposicion ON mediciones(id_exposicion);
 
-- Acelerar los filtros por año en la tabla mediciones.
CREATE INDEX idx_mediciones_anio ON mediciones (anio);


ALTER TABLE ubicaciones_estaciones ADD COLUMN geom GEOMETRY(Point, 4326);
UPDATE ubicaciones_estaciones
SET geom = ST_SetSRID(ST_MakePoint(longitud, latitud), 4326);
CREATE INDEX idx_ubicaciones_estaciones_geom ON ubicaciones_estaciones USING GIST(geom);